// And groups predicates with the AND operator between them.
func And(predicates ...predicate.RecommendationsPMPAApplications) predicate.RecommendationsPMPAApplications {
	return predicate.RecommendationsPMPAApplications(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for _, p := range predicates {
			p(s1)
		}
		s.Where(s1.P())
	})
}

// Or groups predicates with the OR operator between them.
func Or(predicates ...predicate.RecommendationsPMPAApplications) predicate.RecommendationsPMPAApplications {
	return predicate.RecommendationsPMPAApplications(func(s *sql.Selector) {
		s1 := s.Clone().SetP(nil)
		for i, p := range predicates {
			if i > 0 {
				s1.Or()
			}
			p(s1)
		}
		s.Where(s1.P())
	})
}

